CREATE DATABASE IF NOT EXISTS LeagueOfLegendsDataBase;

USE LeagueOfLegendsDataBase;

CREATE TABLE Champion (
    `key` VARCHAR(255) PRIMARY KEY,
    name VARCHAR(255),
    title VARCHAR(255),
    lore TEXT,
    tags TEXT,
    partype VARCHAR(255),
    image_full VARCHAR(255),
    image_loading VARCHAR(255),
    image_square VARCHAR(255)
    );


CREATE TABLE ChampionSkin (
        id INT PRIMARY KEY,
        champion_id VARCHAR(255),
        name VARCHAR(255),
        splash VARCHAR(255),
        centered VARCHAR(255),
        loading VARCHAR(255),
        FOREIGN KEY (champion_id) REFERENCES Champion(`key`)
        );

